                    Press={() => props.navigation.navigate('Signup')} />
            </View>
            <TouchableOpacity onPress={() => navigation.navigate('userDetails')}>User Details</TouchableOpacity>

            </View>
            </View>
    );
}
const styles = StyleSheet.create({})



